CREATE DEFINER=`root`@`localhost` PROCEDURE `total_amount_by_status`(p_fromdate datetime,p_todate datetime,p_status int)
BEGIN
SELECT SUM(od.price * od.quantity) as total_sold
FROM `order` o
JOIN `order_detail` od ON o.id = od.order_id
JOIN `order_status` os ON o.order_status_id = os.id
WHERE os.id = p_status AND o.create_date BETWEEN p_fromdate AND p_todate;
END ;;
